const Navbar = () => {

    return (
        <div className="nav">
            <img src="https://upload.wikimedia.org/wikipedia/commons/thumb/0/08/Netflix_2015_logo.svg/799px-Netflix_2015_logo.svg.png"
                alt="Netflix_Logo" srcset="" />
            <img src="https://upload.wikimedia.org/wikipedia/commons/thumb/0/0b/Netflix-avatar.png/640px-Netflix-avatar.png"
                alt="Netflix_Logo" srcset="" />

        </div>
    )

}

export default Navbar;
